import { useSelector } from "react-redux"
import './play.css'

const Play =  () => {
    const mean = useSelector(state => state.mean)

    const renderedwords = mean.map(mean => (
          <main>
                <h2 className="">{mean.means}</h2>
              <h2>{mean.word.substring(0 , 100)}</h2>
          </main>
    ))

    return (

          <section>
            {renderedwords}
          </section>

    )
}

export default Play
